work to the project's directory\n#Bước 5. Copy framework vào thư mục của project\ncp -R \"${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework\" \"${PROJECT_DIR}\"\n\n# Step 6. Convenience step to open the project's directory in Finder\n#Bước 6. Mở thư mục chứa framework khi build xong\n#open \"${PROJECT_DIR}\"\n";
